import React from "react";
function PosteFichier({post}) {
  
    if(post.Type ==='note')  return <>

        <div className="vote">
            <h4 className="dateNote">mercredi 26 janvier 2022</h4>
            <div className="posteChadow">
                <div className="fichier"></div>
            </div>
        </div>
        

    </>;
}
export default PosteFichier;
